        return(
            <View>
                <Text>Introduzca su correo eléctronico</Text>
                <TextInput>Introduzca su correo eléctronico</TextInput>

                <Text>Introduzca su contraseña</Text>
                <TextInput>Introduzca su contraseña</TextInput>



            </View>



        );


};

export default Signin;
